const digits = '0123456789';
const uppercaseLetters = 'ABCDEFGHIJKLMNOPQRSTUVWXYZ';
const lowercaseLetters = uppercaseLetters.toLowerCase();
const alphabet = [digits, uppercaseLetters, lowercaseLetters].join('').split('')

const randomInt = (min, max) => Math.floor(Math.random() * (max - min + 1)) + min;
const randomItem = (arr) => arr.at(randomInt(0, arr.length - 1))
const randomString = (len) => Array.from({ length: len }).map(() => randomItem(alphabet)).join('')

const randomUid = () => [8,4,4,4,8].map(len => randomString(len)).join("-")
const randomEmail = () => `${randomString(8)}@${randomString(10)}.com`

const randomPerson = () => ({
  uid: randomUid(),
  email: randomEmail(),
  firstname: randomString(5),
  lastname: randomString(12),
  password: randomString(10)
})

return Array.from({ length: 100 }).map(() => ({
  json: randomPerson()
}))
